// ListDisplay.js
import React from 'react';
import  "./display.css"

const Display = ({ dataList }) => {
  return (
    <div className='list'>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Email</th>
            <th>Role</th>
            <th>Classes Handling</th>
            <th>Subjects</th>
          </tr>
        </thead>
        <tbody>
          {dataList.map((item, index) => (
            <tr key={index}>
              <td>{item.name}</td>
              <td>{item.email}</td>
              <td>{item.role}</td>
              <td>{item.classesHandling.join(', ')}</td>
              <td>{item.subjects.join(', ')}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Display;
